import Vue from 'vue'
import VueRouter from 'vue-router'

const SignIn = () =>
    import ('@/views/SignIn.vue')
const SignUp = () =>
    import ('@/views/SignUp.vue')

Vue.use(VueRouter)

const routes = [{
    path: '/user',
    children: [{
            path: 'signup',
            component: SignUp,
        },
        {
            path: 'signin',
            component: SignIn,
        }
    ]
}]


const router = new VueRouter({
    routes,
    base: process.env.NODE_ENV === 'development' ? '' : '/main',
})

export default router
